import React from 'react';
// import './App.css';


const Login = () => {
    return (
    <body class='text-center'>
    <form class='form-signin'>
    <h1 class="h3 mb-3 font-weight-normal">Login or Sign-up</h1>
    <label for="inputUser" class="sr-only">Username</label>
    <input type='text' id="inputUsername" class='form-control' placeholder='Username' required autoFocus></input>
    <label for="inputPass" class="sr-only">Password</label>
    <input type='text' id="inputPassword" class='form-control' placeholder='Password' required></input>
    <button class='btn btn-lg btn-primary' type="submit">Log in</button>
    <button class='btn btn-lg btn-success btn-block' type="submit">Register</button>
    </form>
    {/* <Link to='/login'>login</Link> */}
    </body>
    )
}

export default Login
